import logo from './logo.svg';
import './App.css';
import Row from 'react-bootstrap/Row';
import {Container} from "react-bootstrap";
import {Col} from "react-bootstrap";

function App() {
  return (
      <>
        <Container>
        <Row>
          <Col>1 of 1</Col>
        </Row>
        </Container>


      <div className="align-middle justify-content-center" style={{ display: 'block',
        width: 1000, padding: 30 }}>
        <h1>Fun with AI</h1>
        <Row style={{
          backgroundColor: 'red',
        }}>
          Sample First Row
        </Row>
        <Row style={{
          backgroundColor: 'yellow',
        }}>
          Sample Second Row
        </Row>
        <Row style={{
          backgroundColor: 'green',
        }}>
          Sample Third Row
        </Row>
      </div>
      </>
  );
}

export default App;
